import { ServiceSale } from './../domain/service-sale.class';
import { ProductSale } from './../domain/product-sale.class';

export class Context {

    private _productSaleList: ProductSale[];
    private _serviceSaleList: ServiceSale[];

    constructor() {
        this._productSaleList = [];
        this._serviceSaleList = [];
        this.bootstrap();
    }

    private bootstrap() {
        for (let i = 0; i < 20; i++) {
            let instance = new ProductSale();
            instance.id = 'D12-2683-058' + i;
            instance.name = 'Tênis Nike Dart ' + i;
            instance.description = 'Tenha um aliado na busca por performance nos treinos, com o novo Tênis Nike Dart 12 MSL. Sua estrutura leve e macia, garante ótimo ajuste nos pés, conferindo mais dinamismo as passadas.';
            instance.image = 'data:image/jpeg;base64,';
            instance.price = 199.99;
            instance.storeName = 'NetShoes';
            instance.link = 'http://www.netshoes.com.br/produto/tenis-nike-dart-12-msl-D12-2683-058';
            instance.timestamp = Date.now() + i;
            this._productSaleList.push(instance);
        }

        for (let i = 0; i < 20; i++) {
            let instance = new ServiceSale();
            instance.id = 'D12-2683-058' + i;
            instance.name = 'Passagens para o México e Estados Unidos ida e volta saindo de Porto Alegre! ' + i;
            instance.description = 'A Aeroméxico esta fazendo uma promoção fantástica para a Cidade do México! tem voos saindo de Por Alegre por apenas R$ 315 ida e volta! Isso mesmo! Voos para o México com preço de passagem nacionais! Também tem passagens para Cancún por apenas R$ 994 ida e volta e Cozumel a partir de R$ 515 ida e volta! Mas corram: não sabemos até quando estes preços estarão válidos – podem acabar a qualquer momento!';
            instance.price = 315.00;
            instance.storeName = 'Melhores Destinos';
            instance.link = 'http://www.melhoresdestinos.com.br/promocao/passagens-aereas-mexico-2';
            this._serviceSaleList.push(instance);
        }

    }

    public get productSaleList(): ProductSale[] {
        return this._productSaleList;
    }

    public get serviceSaleList(): ServiceSale[] {
        return this._serviceSaleList;
    }
}
